                    <button onClick={() => onClose(id)}>X</button>
                    <img src={image} alt='' />
                <Link to={`/detail/${id}`}>
                    <h2>{name}</h2>
                </Link>
                    <h4>{temperament}</h4>            
        </div>

        )
    }

